import React, { useState } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
import { DataGrid } from '@mui/x-data-grid';
import CircularProgress from '@mui/material/CircularProgress'; 

export default function PresentationLayer() {

  const rows = [
    { id: 1, shop: 'Shop A', inventory: 'Grocery', products: 'Product 1' },
    { id: 2, shop: 'Shop A', inventory: 'Electronics', products: 'Product 2' },
    { id: 3, shop: 'Shop B', inventory: 'Grocery', products: 'Product 3' },
    { id: 4, shop: 'Shop B', inventory: 'Electronics', products: 'Product 4' }
  ];

  const handleSearch = () => {
    setLoading(true);
    setTimeout(() => {
      setLoading(false);
    }, 1000);
  };

  return (
    <Box sx={{ padding: '20px' }}>
      <Box sx={{ display: 'flex', marginBottom: '10px' }}>
        <TextField
          select
          label="Select Shop"
          fullWidth
          sx={{ width: '50%', marginRight: '10px' }}
        >
          {['Shop A', 'Shop B'].map((shop, index) => (
            <MenuItem key={index} value={shop}>{shop}</MenuItem>
          ))}
        </TextField>
        <TextField
          select
          label="Select Inventory"
          fullWidth
          sx={{ width: '50%' }}
        >
        </TextField>
      </Box>
      <Box sx={{ display: 'flex', justifyContent: 'center', marginBottom: '20px' }}>
        <button onClick={handleSearch} style={{ padding: '10px 20px', fontSize: '16px', borderRadius: '5px', backgroundColor: '#3f51b5', color: '#fff', border: 'none' }}>Search</button>
      </Box>
      {loading ? (
        <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100px' }}>
          <CircularProgress />
        </Box>
      ) : (
        <div style={{ height: 400, width: '100%' }}>
          <DataGrid
            rows={rows}
            columns={[
              { field: 'id', headerName: 'ID', width: 90 },
              { field: 'shop', headerName: 'Shop', width: 150 },
              { field: 'inventory', headerName: 'Inventory', width: 150 },
              { field: 'products', headerName: 'Products', width: 150 }
            ]}
          />
        </div>
      )}
    </Box>
  );
}
